Step-by-step reasoning:

1. Key psychological mechanisms:
 • A proposer’s fairness is influenced by the relative contributions—indexed by tokens—for self and opponent.
 • When contributions are equal, a proposer tends to offer a baseline share (e.g., 50%). Deviations occur if one party’s tokens are higher.
 • The perception of fairness comes from comparing the ratio of the opponent’s tokens to total tokens.

2. Mechanism interaction:
 • Compute the relative contribution: r = token_opp / (token_self + token_opp). A deviation from 0.5 indicates an imbalance.
 • A proposer adjusts the amount proposed to the opponent based on this imbalance. A positive imbalance (r > 0.5) will result in a higher share to the opponent, and vice versa.

3. Mathematical formulation:
 • We posit a linear relation where the predicted proposed percentage (proposed_perc) equals a baseline (delta) when r = 0.5 plus a scaling (lambda_param) of the deviation (r – 0.5). Multiplying the deviation by 100 ensures the adjustment is in percentage points.
 • Thus, the model is given by:
  proposed_perc = delta + lambda_param * ( token_opp/(token_self + token_opp) – 0.5 ) * 100

4. Learnable parameters:
 • delta: A baseline proposer offer when tokens are balanced. Its finite bounds are [0, 100] (percent).
 • lambda_param: The sensitivity to token imbalance. Its finite bounds are set to [-100, 100].
 • Both parameters are chosen to maintain low model complexity and minimize potential parameter covariance during recovery.

5. Mapping to observable behavior:
 • The data provides token_opp and token_self for each trial, from which we compute the relative token ratio.
 • The predicted proposed_perc is directly compared to the observed proposed_perc in the dataset using mean squared error.

