def simulate_model(trial_data, delta=50, lambda_param=0):
    model_predictions = []
    for trial in trial_data:
        token_opp = trial.get("token_opp", 0)
        token_self = trial.get("token_self", 0)

        if (token_self + token_opp) == 0:
            token_ratio = 0.5  # Default to 0.5 if both are 0 to avoid division by zero
        else:
            token_ratio = token_opp / (token_self + token_opp)

        proposed_perc = delta + lambda_param * (token_ratio - 0.5) * 100
        model_predictions.append(proposed_perc)
    return model_predictions
